import React from "react";

export default function Logo() {
  return (
    <div className="logo sm:text-2xl text-md">
      <h1 className="inline-block">&#x0003C;&#x0002F;F</h1>
      <h1 className="inline-block hidden-left">rancisco</h1>
      <h1 className="inline-block">Palio</h1>
      <h1 className="inline-block hidden-right">uras</h1>
      <h1 className="inline-block">&#x0003E;</h1>
    </div>
  );
}
